            ISystemContext context,
            IList<BaseInstanceState> children)
        {
            if (m_setSecurityKeysMethod != null)
            {
                children.Add(m_setSecurityKeysMethod);
            }

            if (m_addConnectionMethod != null)
            {
                children.Add(m_addConnectionMethod);
